import React, { useEffect, useState } from 'react';

function Cars() {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    // Fetch and set cars here
    setCars([{ name: "Car 1", views: 100 }, { name: "Car 2", views: 90 }]);
  }, []);

  return (
    <div>
      <h2>Top Viewed Cars</h2>
      {cars.map((car, index) => (
        <div key={index}>{car.name} - {car.views} views</div>
      ))}
    </div>
  );
}

export default Cars;
